<script>
  import { onMount } from 'svelte';
  import { onInterval } from '../utils/util.js';
  import * as d3 from 'd3';
  import * as m from 'ml-matrix';

  // Matrix coordinates
  let side = 26;
  let eta_mat = {x0: 484.5, y0: 43.5}
  let lam_mat = {x0: 395.5, y0: 43.5}
  let mu_mat = {x0: 484.5, y0: 135.5}
  let sigma_mat = {x0: 395.5, y0: 135.5}

  // Visual
  let std_color = "#008000";
  let meas_color = "#0000FF";
  let state = "Well-defined";
  let showHint = false;

  // Factor graph
  let active_factors = [true, false, true, true, true];
  let z1 = 1;
  let z2 = 2;
  let z3 = 3;
  let z12 = 1;
  let z23 = 1;
  let unary_lams = [1, 1, 1];
  let lam_m12 = 1;
  let lam_m23 = 1;
  let JTJ = new m.Matrix([[1, -1], [-1, 1]]);
  let J = new m.Matrix([[-1], [1]]);
  let lambda = m.Matrix.zeros(3, 3);
  let eta = m.Matrix.zeros(3, 1);
  let sigma = m.Matrix.zeros(3, 3);
  let mu = m.Matrix.zeros(3, 1);

  // Sliding numbers
  let node_mousedown = null;
  let val0 = null;
  let x0 = null;
  let scale_lam = 0.1;
  let scale_z = 0.01;
  let max_lam = 200;
  let max_z = 5;
  let max_prior_mean = 5;
  let dragged_off = [false, false, false, false, false];

  // Gaussian curves
  let paths = [];
  let gauss_max_width = 150;
  let zero = 617.5;
  let scale = 50; // x units to svg units
  let ymap = d3.scaleLinear().domain([0, 1]).range([169, 110]);  // Drawing coords
  let step = 0.1


  function toggle_factor(ix) {
    // If turning on and precision is zero, then set to 1
    if (ix == 0 && !active_factors[0] && unary_lams[0] == 0) {
      unary_lams[0] = 1;
    } else if (ix == 1 && !active_factors[1] && unary_lams[1] == 0) {
      unary_lams[1] = 1;
    } else if (ix == 2 && !active_factors[2] && unary_lams[2] == 0) {
      unary_lams[2] = 1;
    } else if (ix == 3 && !active_factors[3] && lam_m12 == 0) {
      lam_m12 = 1;
    } else if (ix == 4 && !active_factors[4] && lam_m23 == 0) {
      lam_m23 = 1;
    }

    active_factors[ix] = !active_factors[ix];
  }

  function update_paths() {
    for (let i=0; i < 3; ++i) {
      let mean = mu.get(i, 0);
      let mean_svg = zero + mean * scale;
      let std = Math.sqrt(sigma.get(i, i));
      let std_svg = scale * std;

      var width = Math.min(2.6*std_svg, gauss_max_width);

      let xs = d3.range(mean_svg - width, mean_svg + width, step);
      xs = xs.filter(x => x > zero - scale);
      xs = xs.filter(x => x < 853);
      const ys = xs.map(x => Math.exp(-.5 * (x-mean_svg) * (x-mean_svg) / (std_svg * std_svg)));
      
      const pts = d3.zip(xs,ys);
      paths[i] = d3.line()
        .x(d => d[0])
        .y(d => ymap(d[1]))(pts);
    }
  }

  function update_matrices() {

    let include_factors = [true, true, true, true, true]

    // Turn off factors if lam = 0
    for (let i=0; i < 3; ++i) {
      if (!active_factors[i] || unary_lams[i] == 0.) {
        include_factors[i] = false;
      }
    }
    if (!active_factors[3] || lam_m12 == 0.) {
      include_factors[3] = false;
    }
    if (!active_factors[4] || lam_m23 == 0.) {
      include_factors[4] = false;
    }

    lambda = m.Matrix.zeros(3, 3);
    eta = m.Matrix.zeros(3, 1);

    // Contributions from unary factors
    let unary_etas = [unary_lams[0]*z1, unary_lams[1]*z2, unary_lams[2]*z3];

    for (let i=0; i < 3; ++i) {
      if (include_factors[i]) {
        new m.MatrixSubView(lambda, i, i, i, i).add(unary_lams[i]);
        new m.MatrixSubView(eta, i, i, 0, 0).add(unary_etas[i]);
      }
    }

    // Contributions from binary factors
    if (include_factors[3]) {
      new m.MatrixSubView(lambda, 0, 1, 0, 1).add(JTJ.clone().mul(lam_m12));
      new m.MatrixSubView(eta, 0, 1, 0, 0).add(J.clone().mul(lam_m12 * z12));
    }
    if (include_factors[4]) {
      new m.MatrixSubView(lambda, 1, 2, 1, 2).add(JTJ.clone().mul(lam_m23));
      new m.MatrixSubView(eta, 1, 2, 0, 0).add(J.clone().mul(lam_m23 * z23));
    }

    // If no anchors, all nans
    if (!include_factors[0] && !include_factors[1] && !include_factors[2]) {
      sigma = new m.Matrix([[NaN, NaN, NaN],[NaN, NaN, NaN], [NaN, NaN, NaN]]);
      mu = new m.Matrix([[NaN], [NaN], [NaN]]);
    } else if (!include_factors[3] && !include_factors[4]) {
      // All variables in separate
      sigma = m.Matrix.zeros(3, 3);
      mu = m.Matrix.zeros(3, 1);
      for (let i=0; i < 3; ++i) {
        if (include_factors[i]) {
          new m.MatrixSubView(sigma, i, i, i, i).add(1 / unary_lams[i]);
          new m.MatrixSubView(mu, i, i, 0, 0).add(unary_etas[i]/ unary_lams[i]);
        } else {
          mu.set(i, 0, NaN);
          sigma.set(i, 0, NaN);
          sigma.set(i, 1, NaN);
          sigma.set(i, 2, NaN);
          sigma.set(0, i, NaN);
          sigma.set(1, i, NaN);
          sigma.set(2, i, NaN);
        }
      }
    } else if (!include_factors[3]) {
      // Variable 1 on its own
      sigma = m.Matrix.zeros(3, 3);
      mu = m.Matrix.zeros(3, 1);
      if (include_factors[0]) {
        new m.MatrixSubView(sigma, 0, 0, 0, 0).add(1 / unary_lams[0]);
        new m.MatrixSubView(mu, 0, 0, 0, 0).add(unary_etas[0]/ unary_lams[0]);
      } else {
        mu.set(0, 0, NaN);
        sigma.set(0, 0, NaN);
        sigma.set(0, 1, NaN);
        sigma.set(0, 2, NaN);
        sigma.set(1, 0, NaN);
        sigma.set(2, 0, NaN);
      }
      // Check for anchor in graph with nodes 2 and 3
      if (!include_factors[1] && !include_factors[2]) {
        mu.set(1, 0, NaN);
        mu.set(2, 0, NaN);
        sigma.set(1, 1, NaN);
        sigma.set(1, 2, NaN);
        sigma.set(2, 1, NaN);
        sigma.set(2, 2, NaN);
        sigma.set(0, 1, NaN);
        sigma.set(0, 2, NaN);
        sigma.set(1, 0, NaN);
        sigma.set(2, 0, NaN);
      } else {
        let lam_block = new m.Matrix([[lambda.get(1,1), lambda.get(1,2)], [lambda.get(2,1), lambda.get(2,2)]]);
        let eta_block = new m.Matrix([[eta.get(1, 0)], [eta.get(2, 0)]]);
        new m.MatrixSubView(sigma, 1, 2, 1, 2).add(m.inverse(lam_block));
        new m.MatrixSubView(mu, 1, 2, 0, 0).add(m.inverse(lam_block).mmul(eta_block));
      }
    } else if (!include_factors[4]) {
      // Variable 3 on its own
      sigma = m.Matrix.zeros(3, 3);
      mu = m.Matrix.zeros(3, 1);
      if (include_factors[2]) {
        new m.MatrixSubView(sigma, 2, 2, 2, 2).add(1 / unary_lams[2]);
        new m.MatrixSubView(mu, 2, 2, 0, 0).add(unary_etas[2]/ unary_lams[2]);
      } else {
        mu.set(2, 0, NaN);
        sigma.set(2, 0, NaN);
        sigma.set(2, 1, NaN);
        sigma.set(2, 2, NaN);
        sigma.set(0, 2, NaN);
        sigma.set(1, 2, NaN);
      }
      // Check for anchor in graph with nodes 1 and 2
      if (!include_factors[0] && !include_factors[1]) {
        mu.set(0, 0, NaN);
        mu.set(1, 0, NaN);
        sigma.set(0, 0, NaN);
        sigma.set(0, 1, NaN);
        sigma.set(1, 0, NaN);
        sigma.set(1, 1, NaN);
        sigma.set(0, 2, NaN);
        sigma.set(1, 2, NaN);
        sigma.set(2, 0, NaN);
        sigma.set(2, 1, NaN);
      } else {
        let lam_block = new m.Matrix([[lambda.get(0,0), lambda.get(0,1)], [lambda.get(1,0), lambda.get(1,1)]]);
        let eta_block = new m.Matrix([[eta.get(0, 0)], [eta.get(1, 0)]]);
        new m.MatrixSubView(sigma, 0, 1, 0, 1).add(m.inverse(lam_block));
        new m.MatrixSubView(mu, 0, 1, 0, 0).add(m.inverse(lam_block).mmul(eta_block));
      }
    } else {
      sigma = m.inverse(lambda);
      mu = sigma.mmul(eta);
    }

  }

  function check_state() {
    if (!active_factors[0] && !active_factors[1] && !active_factors[2]) {
      state = "Unanchored";
    }
  }

  function reset() {
    active_factors = [true, false, true, true, true];
    z1 = 1;
    z2 = 2;
    z3 = 3;
    z12 = 1;
    z23 = 1;
    unary_lams = [1, 1, 1];
    lam_m12 = 1;
    lam_m23 = 1;
  }

  function unanchor() {
    active_factors = [false, false, false, true, true];
  }

  function anchor1() {
    active_factors = [true, false, false, true, true];
    unary_lams = [70, 1, 1];
    lam_m12 = 5;
    lam_m23 = 5;
  }

  function override_prior3() {
    active_factors = [true, false, true, true, true];
    z1 = 1;
    z2 = 2;
    z3 = 3;
    z12 = 1;
    z23 = 2;
    unary_lams = [50, 1, 1];
    lam_m12 = 70;
    lam_m23 = 70;
  }

  function round(x) {
    x = x.toFixed(1);
    if (x >= 100 || x <= -10) {
      x = parseInt(x);
    }
    if (x % 1 == 0) {
      x = parseInt(x);
    }
    return x;
  }

  function disp_num(x) {
    if (x < 0.01) {
      x = x.toExponential(0);
    } else if ((x*100) % 1 ==0) {
      x = x.toFixed(1);
    } else {
      x = x.toFixed(2);
    }
    return x;
  }

  function callback() {

    update_matrices();
    update_paths();
    check_state();
  }

  onMount(() => {

    update_matrices();

  });

  onInterval(() => callback(), 100);


  // Event handlers

  function mousedown_handler(e) {
    node_mousedown = null;
    node_mousedown = e.composedPath().find((element) => element.classList[0] == "node_g");

    if (node_mousedown) {
      x0 = e.clientX;
      if (node_mousedown.id == "lam0") {
        val0 = unary_lams[0];        
      } else if (node_mousedown.id == "lam1") {
        val0 = unary_lams[1];        
      } else if (node_mousedown.id == "lam2") {
        val0 = unary_lams[2];        
      } else if (node_mousedown.id == "lam3") {
        val0 = lam_m12;        
      } else if (node_mousedown.id == "lam4") {
        val0 = lam_m23;        
      } else if (node_mousedown.id == "eta0") {
        val0 = z1;        
      } else if (node_mousedown.id == "eta1") {
        val0 = z2;        
      } else if (node_mousedown.id == "eta2") {
        val0 = z3;        
      } else if (node_mousedown.id == "eta3") {
        val0 = z12;        
      } else if (node_mousedown.id == "eta4") {
        val0 = z23;        
      }
    }
  }

  function handle_zero_lam(lam, ix) {
    if (lam == 0) {
      dragged_off[ix] = true;
      active_factors[ix] = false;
    }
    if (dragged_off[ix] && lam != 0) {
      active_factors[ix] = true;
      dragged_off[ix] = false;
    }
  }

  function mousemove_handler(e) {
    let x = e.clientX;

    if (node_mousedown) {
      if (node_mousedown.id == "lam0") {
        unary_lams[0] = Math.min(Math.max(0, val0 + scale_lam * (x - x0)), max_lam);
        handle_zero_lam(unary_lams[0], 0);
      } else if (node_mousedown.id == "lam1") {
        unary_lams[1] = Math.min(Math.max(0, val0 + scale_lam * (x - x0)), max_lam);
        handle_zero_lam(unary_lams[1], 1);
      } else if (node_mousedown.id == "lam2") {
        unary_lams[2] = Math.min(Math.max(0, val0 + scale_lam * (x - x0)), max_lam);
        handle_zero_lam(unary_lams[2], 2);
      } else if (node_mousedown.id == "lam3") {
        lam_m12 = Math.min(Math.max(0, val0 + scale_lam * (x - x0)), max_lam);
        handle_zero_lam(lam_m12, 3);
      } else if (node_mousedown.id == "lam4") {
        lam_m23 = Math.min(Math.max(0, val0 + scale_lam * (x - x0)), max_lam);
        handle_zero_lam(lam_m23, 4);
      } else if (node_mousedown.id == "eta0") {
        z1 = Math.min(Math.max(0, val0 + scale_z * (x - x0)), max_prior_mean);
      } else if (node_mousedown.id == "eta1") {
        z2 = Math.min(Math.max(0, val0 + scale_z * (x - x0)), max_prior_mean);
      } else if (node_mousedown.id == "eta2") {
        z3 = Math.min(Math.max(0, val0 + scale_z * (x - x0)), max_prior_mean);
      } else if (node_mousedown.id == "eta3") {
        z12 = Math.min(Math.max(0, val0 + scale_z * (x - x0)), max_z);
      } else if (node_mousedown.id == "eta4") {
        z23 = Math.min(Math.max(0, val0 + scale_z * (x - x0)), max_z);
      }
    }
  }

  function mouseup_handler(e) {
    node_mousedown = null;
  }

	function handleMouseOver(e) {
    let group = e.composedPath().find((element) => element.classList[0] == "node_g");
    if (group.id == "hint-icon") {
        showHint = true;
    }
	}
	function handleMouseOut(e) {
    let group = e.composedPath().find((element) => element.classList[0] == "node_g");
    if (group.id == "hint-icon") {
        showHint = false;
    }
  }


</script>

